INSERT INTO `faqs` VALUES (4,'<p><span style=\"font-size: 1rem;\">എങ്ങനെയാണ് ഈ അപ്ലിക്കേഷൻ ഉപയോഗിക്കുന്ന</span>ത്<span style=\"font-size: 1rem;\">?</span><br></p>','<p>അപ്ലിക്കേഷൻ തുറന്നതിനു ശേഷം, മുൻനിര വിപണികൾ അടുത്തുള്ള ഐക്കൺ സെലക്ട് ചെയ്തു നിങ്ങളുടെ നിലവിലെ സ്ഥാനം സെലക്ട് ചെയുക. അതിനു ശേഷം നിങ്ങള്ക്ക് ഇഷ്ട്ടപെട്ട മാർക്കറ്റ് സെലക്ട് ചെയുക. മാർക്കറ്റിന്റെ താഴത്തായി കാണുന്ന ഷോപ്പിംഗ് ഐക്കണിൽ സെലക്ട് ചെയ്തു നിങ്ങൾക്കാവശ്യമായ സാധനങ്ങൾ സഞ്ചിയിലേക്കു ചേർക്കുക. നിങ്ങളുടെ ഷോപ്പിംഗ് കഴിഞ്ഞുവെങ്കിൽ, നിങ്ങളുടെ സഞ്ചിയിൽ പോയി ചെക്ക്ഔട്ട്    ചെയ്യുക. നിങ്ങൾക്ക് ക്രെഡിറ്റ് കാർഡ് ഉപയോഗിച്ചും, ക്യാഷ് ഓൺ ഡെലിവറി എന്നീ ഓപ്ഷൻ ഉപയോഗിച്ചും നിങ്ങളുടെ ഓർഡർ സബ്മിറ് ചെയ്യാവുന്നതാണ്. <br></p>',2,'2020-06-16 11:39:11','2020-07-08 17:13:43'),(31,'<p>എന്താണ് FoodX ?</p>','<p><span style=\"font-size: 1rem;\">നിങ്ങൾക്ക് വീട്ടിൽ ഇരുന്നുകൊണ്ട് തന്നെ നിങ്ങളുടെ അടുത്തുള്ള സ്റ്റോറുകളിൽ നിന്നും സാധനങ്ങൾ വാങ്ങാവുന്നതാണ്. </span>ഞങ്ങൾ<span style=\"font-size: 1rem;\"> നിങ്ങളുടെ ഓർഡർ പൂർണ്ണ </span>ഉത്തരവാദിത്തത്തോടുകൂടി<span style=\"font-size: 1rem;\"> നിങ്ങളുടെ വീട്ടിൽ എത്തിച്ചു തരുന്നതാണ്. </span><br></p>',2,'2020-07-08 12:55:50','2020-07-13 10:40:24'),(32,'<p>എത്ര സമയത്തിനുള്ളിൽ നിങ്ങൾ ഓർഡർ ഡെലിവറി ചെയ്യും? </p>','<p><span style=\"font-size: 1rem;\">ഞങ്ങളുടെ ഡെലിവറി ടൈം നിങ്ങളുടെ അഡ്രസ്, സ്റ്റോർ അഡ്രെസ്സ് എന്നിവ അനുസരിച്ചായിരിക്കും. നിങ്ങൾ ഓർഡർ </span>ചെയ്തു<span style=\"font-size: 1rem;\">കഴിഞ്ഞാൽ&nbsp;45(</span>ഫുഡ്)<span style=\"font-size: 1rem;\">&nbsp;മിനിറ്റിനുള്ളിൽ ഞങ്ങൾ നിങ്ങളുടെ ഓർഡർ നിങ്ങളുടെ വീടുകളിൽ എത്തിച്ചു തരും (</span>പലചരക്കു സാധനങ്ങൾ ,പച്ചക്കറികൾ ,മരുന്നുകൾ,മൽസ്യം,ഇറച്ചി,എന്നിവ ഓർഡർ ക്രമത്തിൽ നിങ്ങളുടെ വീടുകളിൽ എത്തിക്കുന്നതാണ് )</p>',3,'2020-07-08 13:00:53','2020-07-08 16:39:51'),(33,'<p>എങ്ങനെ ഞങ്ങൾ FoodX&nbsp;നെ വിശ്വസിക്കും?</p>','<p><span style=\"font-size: 1rem;\">FoodX teams പൂർണ്ണ </span>ഉത്തരവാദിത്തത്തോടുകൂടിയാണ് <span style=\"font-size: 1rem;\"> ഓരോ ഓർഡറും കൈകാര്യം ചെയുന്നത്. നിങ്ങൾക്ക് എന്ത് </span>ബുദ്ധിമുട്ടുണ്ടായാലും<span style=\"font-size: 1rem;\"> ഞങ്ങളുടെ </span>കോൾസെന്റർ  <span style=\"font-size: 1rem;\"> നമ്പറിൽ വിളിച്ചു നിങ്ങളുടെ പരാതി രേഖപെടുത്താം. ഞങ്ങളുടെ ക്വാളിറ്റി കണ്ട്രോൾ ടീം നിങ്ങളുടെ പരാതി </span>അന്ന്വേഷിച്ചു<span style=\"font-size: 1rem;\"> നിങ്ങൾക്ക് ആവശ്യമായ എല്ലാ സഹായങ്ങളും ചെയ്യുന്നതാണ്. </span><br></p><p><span style=\"font-size: 1rem;\">FoodX വർക്കലയുടെ </span>സ്വന്തം<span style=\"font-size: 1rem;\"> അപ്ലിക്കേഷൻ ആണ്. എന്ത് ആവശ്യം ഉണ്ടായാലും ഞങ്ങൾ നിങ്ങളുടെ </span>വിളിപ്പുറത്തുണ്ടാകും<br></p><div><br></div>',1,'2020-07-08 13:14:27','2020-07-08 17:12:12'),(34,'<p>FOODX കസ്റ്റമർ സപ്പോർട്ടിനെ എങ്ങനെ കോണ്ടാക്ട് ചെയ്യാൻ പറ്റും?</p><div><br></div>','<p>ഞങ്ങൾ 24/7 ടൈമിലും നിങ്ങളുടെ സപ്പോർട്ടിനായി റെഡി ആണു.&nbsp;</p><p>Phone: +918590709904</p><p>Email: support@deliap.com</p><p><br></p><div><br></div>',2,'2020-07-09 17:15:11','2020-07-15 09:52:44'),(35,'<p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-weight: 700; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">Responsibility for Packaging</span><br style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><br></p>','<p><span style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">The shipper is responsible for adequately packaging all goods to protect the package and ensure safe transportation with ordinary care and handling. The shipper must label each package and further warrants that the contents of the shipment may be lawfully carried over public roads and highways&nbsp; and is not prohibited under any applicable law or regulation. FOODX Delivery Service Inc is not responsible for concealed damage, or damage to goods not boxed or packaged properly.</span><br></p>',4,'2020-07-09 17:39:51','2020-07-09 17:39:51'),(36,'<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\">Filing a Claim</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><br></p>','<p><span style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">All claims must be made in writing within 24 hours of the delivery in which the loss or damage occurred. Claims must be made in writing along with invoice or receipt for damaged goods. If the recipient accepts your package without noting any damage on the delivery record, FoodX Delivery Service Inc will assume that the package was delivered in good condition. In order for FoodX Delivery Service Inc to process your claim, you must, to the extent possible, provide the original cartons and packing for inspection.</span><br></p>',4,'2020-07-09 17:41:59','2020-07-09 18:16:44'),(37,'<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\">Security</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><br></p>','<p><span style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">The site uses SSL (Secured Socket Layer) for communicating with visitors over the Web during critical phases, such as the displaying of personal or financial information or when generating a shipping label. The app also has security measures in place to protect against loss, misuse or alteration of the information under its control. All sensitive data, such as contact information or financial information requested from users, is collected over a secured channel and is stored on a highly secured system. Access to these systems is restricted to authorized users only, and is logged and monitored on a continuous basis. The physical access to these systems is also restricted.</span><br></p>',4,'2020-07-09 17:52:32','2020-07-09 17:52:32'),(38,'<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\">Credit Card Security</span></p>','<p><span style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">We are not aware of any unauthorized use of a credit card as a result of using this site. Under the Fair Credit Billing Act, however, if you were to experience a problem, your credit card provider cannot hold you liable for more than $50.00 of fraudulent charges. If your credit card provider does hold you liable for any of this $50.00 amount, we will cover your entire liability up to the full $50.00. We will only cover this liability if the unauthorized use of your credit card resulted through no fault of your own and only for purchases made at this site while using our secure server. In the event of an unauthorized use of your credit card, you must notify your credit card provider in accordance with its reporting rules and procedures.</span><br></p>',4,'2020-07-09 17:53:27','2020-07-09 17:53:27'),(39,'<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background: transparent; font-weight: 700;\">Online Privacy</span></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; text-size-adjust: 100%; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\"><br></p>','<p><span style=\"color: rgb(102, 102, 102); font-family: Montserrat, Helvetica, Arial, Lucida, sans-serif;\">Privacy and security are at the core of our relationship with our customers. Therefore, we are committed to maintaining the confidentiality of your private information and we use the latest security technology to protect your sensitive data. We do not sell, rent or loan our customers’ names, e-mail addresses, or personal information to anyone at any time for any reason. That means the messages you receive from us will be related to automatic order and dispatch confirmation e-mails generated upon receipt of your order and perhaps occasional e-mail to notify you about special promotions or new services. The site uses visitors’ IP addresses to help diagnose problems with its web server, and to administer the site. IP addresses are not linked to personally identifiable information. The site uses cookies to save registered users’ user name and password, if they choose. The reason for this is so that registered users do not have to re-enter this information each time they visit the site. Visitors also have a choice of rejecting a saved cookie. Rejecting a cookie does not prohibit visitors from accessing and using all the services provided through the site. The site customization form requires users to submit contact information (such as their name and e-mail address). The contact information is used to contact the registered users when necessary (e.g., to confirm a shipment order). Registered users may always opt-out of receiving future mailings (see the choice/opt-out section below). The other optional information collected during registration is used to enhance the users’ experience on the site and to provide a personalized account service. Other optional information collected includes courier preferences and frequently used ship from and ship to addresses. This information is collected to save users time by not making them re-enter the data each time they visit the site. The site uses an order form for visitors to request information, products, and services. The site collects visitors’ contact information (such as their e-mail address) and financial information (such as their credit card numbers). Contact information from the order form is used to fulfill the service, and financial information is used to bill for the service, when ordered. The site collects the address of the receiving party solely for purpose of adding it to the shippers’ address book and is not shared with any outside party. The user can choose not to have the receivers’ address added to their address book simply by un-checking the “Add to Address Book” box when ordering a shipment. This site may contain links to other sites. We are not responsible for the privacy practices or the content of such websites.</span><br></p>',4,'2020-07-09 17:54:44','2020-07-09 17:54:44'),(40,'<blockquote class=\"blockquote\">ഫുഡെക്സ് സ്റ്റോർ കൊണ്ട് എന്ത് നേട്ടങ്ങൾ  ആണ് കസ്ടമർക്കുള്ളത്? <br></blockquote>','<p>കസ്ടമർക്കുള്ള നേട്ടങ്ങൾ&nbsp;</p><p>1 .എന്തിനു Q നിൽക്കണം&nbsp;</p><p>2 .ആവശ്യമുള്ളതുമാത്രം വീട്ടിലിരുന്നുകൊണ്ടു ഓർഡർ ചെയ്യുക&nbsp;</p><p>3 .നിങ്ങൾക്കിഷ്ടമുള്ള സ്റ്റോറിൽനിന്നും അതേ വിലക്കു സാധനം വേടിക്കാം</p><p>4 .ഫുഡ്കസിൽനിന്നും പർച്ചേസ് ചെയ്താൽ സമ്മാനങ്ങളും നേടാം&nbsp;</p><p>5 .നിങ്ങളുടെ&nbsp; ബഡ്ജറ്റിൽ നിന്നുകൊണ്ട് ഷോപ് ചെയ്യാം .</p><p>6 .കോറോണക്കാലം വീട്ടിലിരിക്കാം</p><p>Stay Home Shop Safe&nbsp;</p>',2,'2020-07-10 10:06:07','2020-07-10 10:11:02'),(41,'<p>എങ്ങനെയാണ് ഇതു വർക്കലക്കാരുടെ സ്വന്തം അപ്ലിക്കേഷൻ ആകുന്നത് ?<br></p>','<p>ഉറപ്പായും ഇതു വർക്കലക്കാരുടെ സ്വന്തം അപ്ലിക്കേഷൻ&nbsp; ആണ്, കാരണം ഈ അപ്ലിക്കേഷൻ ചെയ്തിരിക്കുന്നത് വർക്കലയിൽ ജനിച്ചു വളർന്ന ഒരു കൂട്ടം സുഹൃത്തുക്കൾ ചേർന്ന് ഉണ്ടാക്കിയതാണ് .ഉറപ്പായും നിങ്ങൾ ഫുഡെക്സ് വഴി വേടിക്കുന്ന സാധനങ്ങൾക്കും ഫുഡെക്സ് വഴി ചിലവാക്കുന്ന നിങ്ങളുടെ പൈസക്കും ഞങ്ങൾ നിങ്ങൾക്ക് ഗ്യാരന്റി തരുന്നു .</p><div><br></div>',2,'2020-07-10 10:23:46','2020-07-10 10:23:46');
