INSERT INTO `markets` VALUES (11,'Gods Own Country Kitchen','<p><font color=\"#4a4a4a\">സ്വാദിഷ്‌ഠമായ വിവിധതരം രാജ്യങ്ങളുടെ (മൾട്ടി cuisine)</font><span style=\"color: rgb(74, 74, 74); font-size: 1rem;\"> ഫുഡുകൾ ഇനി നിങ്ങളുടെ വീട്ടുപടിക്കൽ.</span></p><p><span style=\"color: rgb(74, 74, 74); font-size: 1rem;\">open at 11am to 9pm</span></p>','North Cliff, Helipad, Varkala','8.7364949','76.7035628','+918590709904','+918590709904','<p>കോവിഡ്-19 മാനദണ്ഡങ്ങൾ പാലിച്ചുകൊണ്ട്‌ ഞങ്ങളുടെ ഡെലിവറി ടീം  ഇനി മുതൽ വർക്കല ഭാഗങ്ങളിലുള്ള  നിങ്ങളുടെ വീടുകളിൽ ഫ്രീയായി എത്തിക്കുന്നതാണ് .<br></p><p>Stay Safe& Shop Safe</p>',5.00,50.00,20.00,0.00,1,0,0,0,1,500,'2020-06-16 12:20:37','2020-07-22 07:11:51'),(13,'Boatman\'s Cafe','<p>സ്വാദിഷ്‌ഠമായ വിവിധതരം രാജ്യങ്ങളുടെ (മൾട്ടി cuisine) ഫുഡുകൾ ഇനി നിങ്ങളുടെ വീട്ടുപടിക്കൽ.</p><p>open at 11am to 9pm</p>','Boatman\'s Cafe,  Varkala, Kerala,695141','8.7429484','76.6638623','+918590709904','+918590709904','<p>കോവിഡ്-19 മാനദണ്ഡങ്ങൾ പാലിച്ചുകൊണ്ട്‌ ഞങ്ങളുടെ ഡെലിവറി ടീം  ഇനി മുതൽ വർക്കല ഭാഗങ്ങളിലുള്ള  നിങ്ങളുടെ വീടുകളിൽ ഫ്രീയായി എത്തിക്കുന്നതാണ് .<br></p><p>Stay Safe& Shop Safe</p>',5.00,50.00,20.00,0.00,1,0,0,0,1,500,'2020-06-17 11:14:31','2020-07-22 08:16:34'),(14,'Fresh Fish & Meat','<p>Daily Fresh Seafood Directly  From The Boat to your door step </p><p><br></p><p><br></p><p><br></p>','North Cliff, Helipad, Varkala','8.716734','76.719545','+918075277457','+918075277457','<p>ഫോർമാലിനും രാസവസ്തുക്കളും ഇല്ലാത്ത വർക്കല,അഞ്ചുതെങ്ങു്, കൊല്ലം , മൽസ്യബന്ധന പ്രദേശങ്ങളിൽനിന്നും ലഭിക്കുന്ന മൽസ്യങ്ങളാണ് നിങ്ങൾക്ക് ലഭിക്കുന്നതെന്ന്‌ ഞങ്ങൾ നിങ്ങൾക്കുറപ്പുതരുന്നു . </p><p>ഉടൻ ആരംഭിക്കും.<br></p><p><br></p>',5.00,50.00,20.00,0.00,1,0,0,1,0,500,'2020-06-29 17:32:06','2020-07-22 11:31:07'),(15,'FoodX Vegetable & Fruits','<p>Fresh Vegetables & Fruits To Your Home Door <br></p>','North Cliff, Helipad, Varkala','8.716734','76.719545','+918589829935','+918075277457','<p>വെജിറ്റബിൾസും, ഫ്രൂട്സും നിങ്ങൾ ഫ്രഷാണെന്നു ഉറപ്പുവരുത്തിയതിനു ശേഷം മാത്രം ഡെലിവറി ചെയ്യുമ്പോൾ സ്വീകരിച്ചാൽ മതി. ഫ്രഷായിരിക്കുമെന്നു ഞങ്ങൾ നിങ്ങൾക്കുറപ്പുതരുന്നു .<br></p>',5.00,50.00,20.00,0.00,1,0,0,0,1,300,'2020-06-29 17:47:56','2020-07-22 08:17:55'),(18,'Cake Fairy','<p>ഫ്രഷ് ഹോംമെയ്ഡ് കേക്കുകൾ!!!!!! Birthdays,Anniversary\'s, etc.. <br></p>','Varkala , Puthenchantha','8.716734','76.719545','+918590709904','+918590709904','ഹോംമെയ്ഡ് കേക്കുകൾ ആയതിനാൽ 3 ദിവസങ്ങൾക്ക് മുൻപേ ഓർഡർ ചെയ്യേണ്ടതാണ്. ( ഓർഡർ ചെയ്തതിനു ശേഷം നിങ്ങൾക് ക്യാൻസൽ ചെയ്യണമെങ്കിൽ 24 മണിക്കൂറുകൾക്കകം ചെയ്യേണ്ടതാണ് ). ',5.00,50.00,20.00,0.00,1,0,0,0,1,500,'2020-07-10 11:03:46','2020-07-22 11:31:44'),(19,'K-Mart','<p><br></p><div><div>പ്രിയപ്പെട്ടവരെ, വർക്കല ശ്രീ ജനാർദ്ദനസ്വാമി ക്ഷേത്രത്തിനു സമീപം ഞങ്ങളുടെ ഒരു പുതിയ ശാഖകൂടി പ്രവർത്തനം ആരംഭിക്കുകയാണ്.K -MART പരമ്പരാഗത സൂപ്പർ മാർക്കറ്റ് ആശയങ്ങളിൽ നിന്നും വ്യത്യസ്തമായി ജൈവ പച്ചക്കറികൾക്കും, പലവ്യഞ്ജനങ്ങൾക്കും മാത്രമായി ഒരു സെക്ഷൻ കൂടി ഉൾപ്പെടുത്തിയിരിക്കുന്നു . നവജാത ശിശുക്കൾക്ക് ആവശ്യമായ എല്ലാ ഉൽപ്പന്നങ്ങൾക്കുമായി ഒരു കിഡ്സ് കോർണർ, കൂടാതെ കർഷകർക്ക്, നാടൻ ജൈവ ഉത്പന്നങ്ങൾ വിൽക്കുവാനുള്ള വിപണി സൗകര്യവും ഒരുക്കിയിട്ടുണ്ട്. ഗവൺമെന്റിന്റെ കോവിഡ് സുരക്ഷാ മാനദണ്ഡങ്ങൾ പൂർണമായും പാലിച്ചുകൊണ്ട്‌ ഈ വരുന്ന ജൂലൈ 15 ബുധനാഴ്ച മുതൽ K -MART തുറന്നു പ്രവർത്തനം ആരംഭിക്കുകയാണ്. എല്ലാവരുടെയും സഹകരണം പ്രതീക്ഷിച്ചുകൊ</div><div><br></div><div>പ്രിയപ്പെട്ടവരെ,</div><div><br></div><div><br></div><div><br></div><div>  വർക്കല ശ്രീ ജനാർദ്ദനസ്വാമി ക്ഷേത്രത്തിനു സമീപം ഞങ്ങളുടെ ഒരു പുതിയ ശാഖകൂടി പ്രവർത്തനം ആരംഭിക്കുകയാണ്.K -MART </div><div><br></div><div><br></div><div><br></div><div>പരമ്പരാഗത സൂപ്പർ മാർക്കറ്റ് ആശയങ്ങളിൽ നിന്നും വ്യത്യസ്തമായി ജൈവ പച്ചക്കറികൾക്കും, പലവ്യഞ്ജനങ്ങൾക്കും മാത്രമായി ഒരു സെക്ഷൻ കൂടി ഉൾപ്പെടുത്തിയിരിക്കുന്നു .</div><div><br></div><div><br></div><div><br></div><div>നവജാത ശിശുക്കൾക്ക് ആവശ്യമായ എല്ലാ ഉൽപ്പന്നങ്ങൾക്കുമായി ഒരു കിഡ്സ് കോർണർ, കൂടാതെ കർഷകർക്ക്, നാടൻ ജൈവ ഉത്പന്നങ്ങൾ വിൽക്കുവാനുള്ള വിപണി സൗകര്യവും ഒരുക്കിയിട്ടുണ്ട്.</div><div><br></div><div><br></div><div><br></div><div>ഗവൺമെന്റിന്റെ കോവിഡ് സുരക്ഷാ മാനദണ്ഡങ്ങൾ പൂർണമായും പാലിച്ചുകൊണ്ട്‌ ഈ വരുന്ന ജൂലൈ 15 ബു