help protect those who\'ve had a heart attack in the past.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:27:02','2020-07-02 16:27:02'),(853,'Squid (Kanava OR Chadayan)',500.00,400.00,'<p><span class=\"ILfuVd NA6bn\" style=\"line-height: 1.375; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><span class=\"e24Kjd\" style=\"padding: 0px 8px 0px 0px;\">A 3-ounce serving of uncooked&nbsp;<b>squid</b>&nbsp;contains around 198 milligrams of cholesterol and 13.2 grams of protein along with 0.3 grams of total saturated fat. ... These fats can help raise&nbsp;<b>your</b>&nbsp;levels of high-density lipoprotein (HDL), the “<b>good</b>” cholesterol.</span></span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:30:19','2020-07-02 16:30:19'),(854,'Grouper ( Azhuka)',350.00,NULL,'<p><span class=\"ILfuVd NA6bn\" style=\"line-height: 1.375; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><span class=\"e24Kjd\" style=\"padding: 0px 8px 0px 0px;\">This type of&nbsp;<b>fish</b>&nbsp;has a very mild&nbsp;<b>flavor</b>&nbsp;(somewhere in between seabass and halibut) with a light, sweet&nbsp;<b>taste</b>&nbsp;and large, chunky flakes, almost&nbsp;<b>like</b>&nbsp;lobster or crab. Thanks to its subtle&nbsp;<b>flavor</b>&nbsp;that easily absorbs dressings and marinades,&nbsp;<b>grouper</b>&nbsp;is excellent however you serve it.</span></span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:36:59','2020-07-02 16:36:59'),(855,'Mahi Mahi (pullimotha)',450.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Fresh&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Mahi Mahi</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;from Pucci Foods is also an excellent source of several vitamins, amino acids, and&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">fish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;oil. Combined,&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Mahi Mahi</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;is a delicious serving of succulent protein that helps the body reduce the risk of heart disease and cancer, fight inflammation, and maintain&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;functions.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:39:21','2020-07-02 16:39:21'),(856,'Crab (Njhandu)',800.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Rich in vitamins and minerals,&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">crab meat</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;is also low in fat and contains Omega-3 polyunsaturated acids. Helps provide protection from heart disease and aids brain development. Some research suggests that Omega-3 also inhibits aggressive behaviour.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:42:54','2020-07-02 16:42:54'),(857,'Lobster (Rall)',1200.00,NULL,'<p><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Lobsters</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> are a great source of selenium and also contain omega-3 fatty acids. They can help protect against thyroid disease, depression, and anemia. </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Lobster</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> can serve as the main source of protein in a meal. Defrost frozen </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">lobster</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> in the refrigerator, not at room temperature</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:49:17','2020-07-02 16:49:17'),(858,'Sail Fish ( Ola Thala)',600.00,NULL,'<p><span style=\"color: rgb(40, 40, 41); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Helvetica Neue&quot;, sans-serif; font-size: 15px;\">Yes, they’re quite edible. Marlin (sail fish) steaks are very tasty, and quite prized.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:55:08','2020-07-02 16:55:08'),(859,'Tiger prwans (Pulivarayan Konju)',900.00,800.00,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Not only are&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">tiger prawns</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;delicious, they also have an impressive nutritional profile. They are a low-fat source of high-quality protein which makes them a healthier choice for protein than red meat, and with a lot less calories.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 16:58:58','2020-07-02 16:58:58'),(860,'Mackeral Fish (Aila Fish)',400.00,300.00,'<p><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Mackerel fish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;is not only rich in monounsaturated fatty acids and polyunsaturated fatty acids but also is also low in saturated fats. ... High levels of potassium present in this&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">fish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;helps in maintaining normal blood pressure in addition to lowering the risk of health complications associated with the condition</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 17:02:35','2020-07-02 17:02:35'),(861,'Horse Mackerel (Kozhiyala)',350.00,NULL,'<p><span class=\"ILfuVd NA6bn\" style=\"line-height: 1.375; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><span class=\"e24Kjd\" style=\"padding: 0px 8px 0px 0px;\"><b>Horse Mackerel</b>&nbsp;or Scad is a wonderful&nbsp;<b>eating</b>&nbsp;fish. The name is a little misleading in that it is not a&nbsp;<b>mackerel</b>&nbsp;type, in fact it is not even the same family. This idea that it is more bony than other fish is pure myth. It does require a little more preparation than a normal&nbsp;<b>mackerel</b>.</span></span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-02 17:13:53','2020-07-02 17:13:53'),(865,'സവാള (Onion)',13.00,NULL,'<ul class=\"i8Z77e\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">Onions are nutrient-dense, meaning they\'re low in calories but high in vitamins and minerals. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">May Benefit Heart Health. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">Loaded With Antioxidants. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">Contain Cancer-Fighting Compounds. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">Help Control Blood Sugar. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">May Boost Bone Density. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">Have Antibacterial Properties. ...</li><li class=\"TrT0Xe\" style=\"margin: 0px 0px 4px; padding: 0px; border: 0px; list-style-type: disc;\">May Boost Digestive Health.</li></ul>',500.00,0.00,'g',1,1,15,41,'2020-07-03 13:55:27','2020-07-16 09:53:43'),(867,'തക്കാളി (Tomato)',22.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Tomatoes are the major dietary source of the antioxidant lycopene, which has been linked to many health </span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">benefits, including reduced risk of heart disease and cancer. They are also a great source of vitamin C, potassium, folate, and vitamin K.</span><br></p>',500.00,0.00,'g',1,1,15,41,'2020-07-03 14:04:47','2020-07-16 08:54:15'),(870,'ക്യാരറ്റ് (Carrot)',23.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">It is crunchy, tasty, and highly nutritious. Carrots</span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> are a particularly good</span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> source of beta carotene, fiber, vitamin K1, potassium, and antioxidants ( 1 ).</span><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">They\'re a weight-loss-friendly food and have been linked to lower cholesterol levels and improved eye health.</span><br></p>',500.00,0.00,'g',1,1,15,41,'2020-07-03 14:17:10','2020-07-16 09:48:47'),(871,'ബീറ്റ്റൂട്ട് (BeetRoot)',24.00,NULL,'<p><span class=\"ILfuVd\" style=\"line-height: 1.375; color: rgb(34, 34, 34); font-family: arial, sans-serif;\"><span class=\"e24Kjd\" style=\"padding: 0px 8px 0px 0px;\">Packed with essential nutrients, beetroots are a great source of fiber, folate (vitamin B9), manganese, potassium, iron, and vitamin C.Beetroot and beetroot juice have been associated with numerous health benefits including improved blood flow, lower blood pressure, and increased exercise performance.</span></span><br></p>',500.00,0.00,'g',1,1,15,41,'2020-07-03 14:20:06','2020-07-16 08:54:42'),(874,'കോളിഫ്ലവർ (Cauliflower)',23.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Cauliflower is a cruciferous vegetable that is naturally high in fiber and B-vitamins. It provides antioxidants and phytonutrients that can protect against cancer. It also contains fiber to enhance weight loss and digestion, choline that is essential for learning and memory.</span><br></p>',500.00,0.00,'g',1,1,15,41,'2020-07-04 15:02:38','2020-07-16 09:58:01'),(877,'Vela(വേള)',750.00,600.00,'<p>Fish Always Good For Health</p>',1.00,0.00,'kg',1,1,14,40,'2020-07-04 15:42:29','2020-07-04 15:42:29'),(878,'Mixed Veg. Korma',140.00,NULL,'<p>Mixed veg. with milk yellow sauce.</p>',NULL,1.00,NULL,0,1,13,27,'2020-07-07 06:34:21','2020-07-21 03:23:06'),(879,'നെയ്മീൻ (Seer Fish/Queen Fish)',900.00,800.00,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">treat Surmai as a delicacy. Categorically, Surmai is a type of mackerel and is called “</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">King</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;Mackerel” or “Indo-Pacific Mackerel”. As you can see, Surmai is rich in protein,&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">good</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;in Omega 3 and potent with respect to other minerals and vitamins.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 15:26:17','2020-07-07 15:26:17'),(880,'തിരണ്ടി ( Stingray)',250.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">In short, yes you can&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">eat stingray</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;and it is safe to&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">consume</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">. ... Caught using fishing lines or spears, they\'re an interesting type of seafood you can&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">eat</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 15:34:11','2020-07-07 15:34:11'),(882,'വറ്റ (  Bluefin Trevally)',500.00,NULL,'<p><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: 13px;\">They are also great to&nbsp;</span><span style=\"font-weight: bold; color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: 13px;\">eat</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: 13px;\">&nbsp;as they have lots of&nbsp;</span><span style=\"font-weight: bold; color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: 13px;\">healthy</span><span style=\"color: rgb(84, 84, 84); font-family: arial, sans-serif; font-size: 13px;\">&nbsp;fats and nutrients.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 15:41:31','2020-07-07 15:41:31'),(883,'കിളിമീൻ/ചെങ്കലവ(Threadfin Bream)',500.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Threadfin bream commonly known as </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Kilimeen</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">/Chengavaal, is frequently consumed </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">seafood</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">. Cooking Threadfin bream has fine-textured flesh and a sweet, delicate flavour. The </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">best</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> ways to cook the Threadfin Bream are steaming, baking or barbequing - wrapped in foil or banana leaves.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 15:50:41','2020-07-07 15:52:26'),(885,'പരവ(False Trevally)',750.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">It is a&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">good</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;source of thiamine, riboflavin, vitamin B6 and phosphorus, and a very&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">good</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;source of protein, vitamin A, niacin, vitamin B12 and selenium. The health benefits of the&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">false trevally</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;include&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;heart,&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;cardio-vascular system, strong bones and muscles,&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;skin and hair etc.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 16:03:49','2020-07-07 16:03:49'),(886,'ശീലാവ്/നെടുവ(Barracuda)',450.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">barracuda</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;meat is firm, with a large flake and moderate fat content. It has a full, meaty&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">flavor</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">. Cooking Tips: The firm-fleshed&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">barracuda</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;fillets and steaks hold together well during grilling or broiling, the favorite preparation methods for this fish</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 16:08:56','2020-07-07 16:08:56'),(887,'കൊഴുവ(Indian Anchovy)',300.00,NULL,'The anchovy, being an oily fish, is rich in omega-3 fatty acids, well known for its ability to lower levels of triglycerides and cholesterol in the blood. It is also an excellent source of protein, with a fish of average size providing around 9g of protein and only 55 calories.',1.00,0.00,'kg',1,1,14,40,'2020-07-07 16:13:41','2020-07-07 16:13:41'),(888,'പൂമീൻ(Milk Fish)',300.00,NULL,'<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Weight gain: The good: This&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">food</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;is low in Sodium. It is also a good source of Vitamin B6, Phosphorus and Selenium, and a very good source of Protein, Niacin and Vitamin B12. The bad: This&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">food</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">&nbsp;is high in Cholesterol.</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 16:22:26','2020-07-07 16:22:26'),(889,'കാരി(Cat Fish)',500.00,NULL,'<p><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">Catfish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> has low-calorie content and fat, and including </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">catfish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> in your diet is a </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> option. It contains </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">healthy</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> fatty acids such as omega 3 and omega 6. The Environmental Protection Agency has listed </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">catfish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> as the most consumed </span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\">fish</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif;\"> due to its low mercury content).</span><br></p>',1.00,0.00,'kg',1,1,14,40,'2020-07-07 16:25:26','2020-07-07 16:26:15'),(890,'ബീൻ‍സ് (Green Beans)',25.00,NULL,'<p>Green beans are the unripe, young fruit and protective pods of various cultivars of the common bean. Immature or young pods of the runner bean, yard long bean, and hyacinth bean are used in a similar way.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:06:05','2020-07-16 08:56:51'),(891,'മല്ലി ഇല (Coriander Leaves)',18.00,NULL,'<p>Coriander is an herb that\'s commonly used to flavor international dishes. It comes from the Coriandrum sativum plant and is related to parsley, carrots, and celery.<br></p>',250.00,NULL,'g',0,1,15,41,'2020-07-08 12:17:00','2020-07-16 09:06:00'),(892,'പുതിന (Mint Leaves)',16.00,NULL,'<p>Mint leaves are a tender herb with gentle stems. It is best to add them raw or at the end of the cooking process.<br></p>',250.00,NULL,'g',1,1,15,41,'2020-07-08 12:22:21','2020-07-16 09:01:05'),(893,'കറിവേപ്പില (Curry Leaves)',15.00,NULL,'<p>Curry leaves can also be used for weight loss. They are rich in Vitamin A, B, C and B2. Curry leaves are also said to be good sources of iron and calcium. Because of this reason, curry leaves are used as part of folklore medicine to treat calcium deficiency and several other conditions.<br></p>',250.00,NULL,'g',1,1,15,41,'2020-07-08 12:27:33','2020-07-16 09:55:47'),(894,'പയർ (Peas)',25.00,NULL,'<p>Green peas contain a decent amount of heart-healthy minerals, such as magnesium, potassium and calcium. ... Green peas also provide flavonols, carotenoids and vitamin C, antioxidants that have been shown to reduce the likelihood of heart disease and stroke due to their ability to prevent damage to cells ( 24 , 25 , 26 )<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:33:33','2020-07-16 09:43:33'),(895,'കാപ്സിക്കം (Capsicum)',50.00,NULL,'<p>Capsicums are an excellent source of vitamin A and C (red contain more than green capsicums).They are also a good source of dietary fibre, vitamin E, B6 and folate.</p><p><br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:38:36','2020-07-16 09:03:08'),(897,'പച്ച മാങ്ങ (Green Mango)',30.00,NULL,'<p>Unripe mangoes help in treating liver disorders because they increase the secretion of bile acids and clean the intestines of bacterial infections. They also have more Antioxidants and Vitamin C than ripe mangoes. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:46:56','2020-07-16 09:55:09'),(898,'വെളളരിക്ക ( Small Cucumber)',25.00,NULL,'<p>Cucumber (Cucumis sativus) is a widely-cultivated creeping vine plant in the Cucurbitaceae. Lebanese cucumbers are small, smooth-skinned and mild, yet with a distinct flavor and aroma.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:50:22','2020-07-16 09:54:09'),(899,'കോവയ്ക്ക (Ivy Gourd)',12.00,NULL,'<p>Coccinia grandis, the ivy gourd, also known as scarlet gourd, tindora and kowai fruit, is a tropical vine. It grows primarily in tropical climates and is commonly found in the southern Indian states, where it forms a part of the local cuisine. Coccinia grandis is cooked as a vegetable. <br></p>',250.00,NULL,'g',0,1,15,41,'2020-07-08 12:53:00','2020-07-16 09:04:23'),(900,'ചെറുനാരങ്ങ (Lemon)',24.00,NULL,'<p>It\'s a good source of vitamin C Citrus fruits like lemons are high in vitamin C, a primary antioxidant that helps protect cells from damaging free radicals. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 12:55:54','2020-07-16 09:05:01'),(901,'ഇഞ്ചി (Ginger)',23.00,NULL,'<p>Ginger is a flowering plant whose rhizome, ginger root or ginger, is widely used as a spice and a folk medicine. It is a herbaceous perennial which grows annual pseudostems about one meter tall bearing narrow leaf blades.<br></p>',250.00,NULL,'g',0,1,15,41,'2020-07-08 12:58:37','2020-07-16 09:05:44'),(902,'തേങ്ങ (Coconut)',55.00,NULL,'<p>The coconut tree (Cocos nucifera) is a member of the palm tree family (Arecaceae) and the only living species of the genus Cocos<br></p>',1.00,NULL,'kg',1,1,15,41,'2020-07-08 13:02:05','2020-07-16 09:52:50'),(904,'ചേന (Elephant Foot Yam)',18.00,NULL,'<p>Yams contain high carbohydrate, protein, vitamins, antioxidants, minerals, and dietary fibers. They are known to help the digestive system<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-08 13:07:22','2020-07-16 09:56:27'),(905,'സിട്രസ് ഓറഞ്ച് (Citrus Orange)',63.00,NULL,'<p>The orange is the fruit of various citrus species in the family Rutaceae; it primarily refers to Citrus × sinensis, which is also called sweet orange, to distinguish it from the related Citrus × aurantium, referred to as bitter orange. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 08:34:39','2020-07-16 14:41:29'),(906,'ആപ്പിൾ ഗാല (Apple Gala)',100.00,NULL,'<p>A crisp, sweet apple with a mild flavor, Galas have yellow-orange skin with red striping. They\'re among the best apples for applesauce, salads, eating out-of-hand, and pressing into cider.<br></p>',500.00,0.00,'g',1,1,15,41,'2020-07-09 08:37:32','2020-07-16 09:59:06'),(907,'ആപ്പിൾ യുഎസ്എ (Apple USA)',90.00,NULL,'<p>Crisp and juicy with a sweet and slightly tart flavor.<br></p>',500.00,NULL,'g',0,1,15,41,'2020-07-09 08:40:41','2020-07-16 14:07:40'),(908,'മാതളനാരങ്ങ (Anar)',56.00,NULL,'<p>The pomegranate is known as a superfood. Its jewel-like seeds (arils) have been used for medicinal purposes for millennia. Packed with powerful antioxidants and vitamins, this ruby-red fruit has been shown to be a cure-all for just about any ailment.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 08:46:18','2020-07-16 14:43:56'),(909,'ഓറഞ്ച് (Orange)',55.00,NULL,'<p>The orange is the fruit of various citrus species in the family Rutaceae; it primarily refers to Citrus × sinensis, which is also called sweet orange.<br></p>',500.00,NULL,'g',0,1,15,41,'2020-07-09 10:31:25','2020-07-16 14:45:04'),(910,'മുന്തിരി (Juice Grape)',40.00,NULL,'<p>A grape is a fruit, botanically a berry, of the deciduous woody vines of the flowering plant genus Vitis. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 10:34:31','2020-07-16 14:46:06'),(911,'മുന്തിരി (Grape rose)',37.00,NULL,'<p>Grapes can be eaten fresh as table grapes or they can be used for making wine, jam, grape juice, jelly, grape seed extract, raisins, vinegar, and grape seed oil.<br></p>',500.00,NULL,'g',0,1,15,41,'2020-07-09 10:38:22','2020-07-16 14:46:45'),(912,'അവോക്കാഡോ (Butter Fruit)',75.00,NULL,'<p>Butter fruit contains a high amount of potassium and carbohydrates, it can be mixed with sugar and milk and consumed directly.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 10:42:49','2020-07-16 14:47:19'),(913,'തണ്ണിമത്തൻ (Watermelon)',18.00,NULL,'<p>Watermelon is a delicious and refreshing fruit that\'s also good for you. It contains only 46 calories per cup but is high in vitamin C, vitamin A and many healthy plant compounds.<br></p>',1.00,NULL,'kg',0,1,15,41,'2020-07-09 10:45:33','2020-07-16 14:48:10'),(914,'ഷമാം (Sweet Melon)',30.00,NULL,'<p>Shamam are monoecious plants. They are abundantly available in the summers and have a super high percentage of water content <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 10:49:24','2020-07-17 04:28:17'),(915,'പച്ച മുന്തിരി  (Green Grapes)',40.00,NULL,'<p>The nutrients in grapes may help protect against cancer, eye problems, cardiovascular disease, and other health conditions. Resveratrol is a key nutrient in grapes that may offer health benefits. <br></p>',500.00,NULL,'g',0,1,15,41,'2020-07-09 10:51:55','2020-07-16 15:12:29'),(916,'പപ്പായ (Papaya)',45.00,NULL,'<p>Papayas contain an enzyme called papain that aids digestion; in fact, it can be used as a meat tenderizer. Papaya is also high in fiber and water content<br></p>',1.00,NULL,'kg',0,1,15,41,'2020-07-09 10:54:24','2020-07-16 15:12:02'),(917,'കിവി (Kiwi)',50.00,NULL,'<p>Kiwis are small fruits that pack a lot of flavor and plenty of health benefits. Their green flesh is sweet and tangy. It\'s also full of nutrients like vitamin C, vitamin K, vitamin E, folate, and potassium. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 10:59:22','2020-07-16 15:09:52'),(918,'സ്ട്രോബെറി (Strawberry)',45.00,NULL,'<p>The tiny strawberry is packed with vitamin C, fiber, antioxidants, and more. The heart-shaped silhouette of the strawberry is the first clue that this fruit is good for you. These potent little packages protect your heart, increase HDL (good) cholesterol, lower your blood pressure, and guard against cancer.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 12:46:47','2020-07-16 14:17:12'),(919,'പച്ച ആപ്പിൾ (Green Apple)',80.00,NULL,'<p>Green apples are light green in colour and have crisp and juicy white flesh, which has a tart taste compared to red apples. <br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 13:01:39','2020-07-16 14:16:20'),(920,'പിയർ (pear)',65.00,NULL,'<p><br></p><p>Pears are sweet, bell-shaped fruits that have been enjoyed since ancient times. They can be eaten crisp or soft. They\'re not only delicious but also offer many health benefits backed by science.</p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 13:03:43','2020-07-16 14:11:09'),(921,'മാമ്പഴം (Mango)',40.00,NULL,'<p>A mango is a juicy stone fruit produced from numerous species of tropical trees belonging to the flowering plant genus Mangifera, cultivated mostly for their edible fruit.<br></p>',500.00,NULL,'g',1,1,15,41,'2020-07-09 13:06:45','2020-07-16 14:10:03'),(922,'കൈതച്ചക്ക (Pineapple)',30